/**
=========================================================
* Argon Dashboard 2 MUI - v3.0.1
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-material-ui
* Copyright 2023 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Card from "@mui/material/Card";
import TextField from "@mui/material/TextField";
import InputAdornment from "@mui/material/InputAdornment";
import SearchIcon from "@mui/icons-material/Search";
import Button from "@mui/material/Button";
import MapIcon from "@mui/icons-material/Map";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";

// Argon Dashboard 2 MUI components
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";

// Argon Dashboard 2 MUI examples
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import Table from "examples/Tables/Table";

// Data
import authorsTableData from "layouts/tables/data/authorsTableData";
import hospitalsTableData from "layouts/Hospitals/data/projectsTableData";
import hotelsTableData from "layouts/tables/data/hotelsTableData";
import React, { useState } from 'react';

function Hospitals() {
  const { columns: prCols, rows: prRows } = hospitalsTableData;
  const [tabValue, setTabValue] = React.useState(0);
  const [licenseFilter, setLicenseFilter] = React.useState("all");
  const [taxStatusFilter, setTaxStatusFilter] = React.useState("all");

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const handleLicenseFilterChange = (event) => {
    setLicenseFilter(event.target.value);
  };

  const handleTaxStatusFilterChange = (event) => {
    setTaxStatusFilter(event.target.value);
  };

  const filteredRows = prRows.filter((row) => {
    const licenseStatus = row["license status"].props?.['data-status']; // Assuming 'data-status' is used for license status
    const taxStatus = row["paye tax status"].props?.['data-status']; // Assuming 'data-status' is used for tax status as well

    return (licenseFilter === "all" || licenseStatus === licenseFilter) &&
           (taxStatusFilter === "all" || taxStatus === taxStatusFilter);
  });

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <ArgonBox py={3}>
        <Card>
          <ArgonBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
            <ArgonTypography variant="h6">Hospitals</ArgonTypography>
            <TextField
              placeholder="Search..."
              variant="outlined"
              size="small"
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon />
                  </InputAdornment>
                ),
              }}
            />
          </ArgonBox>
          <Tabs value={tabValue} onChange={handleTabChange} aria-label="hospital type tabs" sx={{ fontSize: '0.75rem' }}>
            <Tab label="Public Hospitals" />
            <Tab label="Private Hospitals" />
          </Tabs>
          <ArgonBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
            <Select
              value={licenseFilter}
              onChange={handleLicenseFilterChange}
              displayEmpty
              inputProps={{ 'aria-label': 'License Filter' }}
              size="small"
              sx={{ width: 150 }}
            >
              <MenuItem value="all">All Licenses</MenuItem>
              <MenuItem value="renewed">Renewed</MenuItem>
              <MenuItem value="expired">Expired</MenuItem>
            </Select>
            <Select
              value={taxStatusFilter}
              onChange={handleTaxStatusFilterChange}
              displayEmpty
              inputProps={{ 'aria-label': 'Tax Status Filter' }}
              size="small"
              sx={{ width: 150, ml: 2 }}
            >
              <MenuItem value="all">All Tax Status</MenuItem>
              <MenuItem value="paid">Paid</MenuItem>
              <MenuItem value="unpaid">Unpaid</MenuItem>
            </Select>
          </ArgonBox>
          <ArgonBox
            sx={{
              "& .MuiTableRow-root:not(:last-child)": {
                "& td": {
                  borderBottom: ({ borders: { borderWidth, borderColor } }) =>
                    `${borderWidth[1]} solid ${borderColor}`,
                },
              },
            }}
          >
            <Table columns={prCols} rows={filteredRows} />
          </ArgonBox>
        </Card>
      </ArgonBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Hospitals;
